        <div class=""section"" id=""day6"">

            <div class=""bgdark"">
                <h1>Elephant Sands</h1>
                Elephant Sands is a bush lodge & campsite in the north-eastern part of Botswana. There you enjoy viewing the elephants at the natural waterhole right in front of the lodge. Watch these impressive creatures whilst they drink at only a couple of meters away from you, a unique experience! There is plenty of other wildlife around as well on our unfenced 16000 ha private conservancy. The lack of fences allows all animals to roam freely. It is ideal");
                WriteLiteral(@"ly located in the centre of Botswana’s highlights, such as: the Makgadikgadi pans, the Okavango delta and Chobe National Park. Victoria Falls and Hwange National Park are at the doorstep so to speak.

