                WriteLiteral(@"otic birdlife. Spend time exploring the maze of lagoons, lakes and streams on foot, led by experienced and knowledge guides. Tonight you will cam on a remote island in the heart of the wilderness. In this far out spot, facilities are nonexistent, so you will dig a bush toilet and go without a shower. It’s part of the Okavango experience. At night, fall asleep to the humming and buzzing of African wilderness

